import React from 'react'
import { makeStyles } from '@material-ui/core/styles';
import Button from '@material-ui/core/Button';


const useStyles = makeStyles((theme) => ({
    root: {
        width: '100%', 
        minHeight:800,
        backgroundColor:'#1a1a1aff',
        display: 'flex',
        flexDirection:'column',
        },
    mainText: {
        fontSize:70,
        fontFamily: "Lucida Console",
        color:'white',
    },
    smallText: {
        fontSize:28,
        fontFamily: "Candara",
        color:'white',
    },
    blueText:{
        color: 'aqua'
    },
    button:{
        width:150,
        height:50,
        marginRight:'2%',
    },
    navbar:{
        display: 'flex',
        flexDirection: 'row',
        margin: '0 33%',
    },
    navbarElements:{
        margin:'4%',
        color:'gray',
        textDecoration:'none',
    }
}));

function Frontpage() {
    const classes = useStyles()
    return (
        <div className={classes.root}>
            <section>

            </section>
            
        </div>
    )
}

export default Frontpage
